// import library
import { Link } from 'react-router-dom'

// import image
import bg from '../../assets/images/bg/login-bg.jpg'

function Login(props) {
    return (
        <div className='min-login'>
            <img src={bg} className='min-login-bg'/>
            <div className='min-login-wrapper'>
                
            </div>
        </div>
    );
}

export default Login;
